INSERT INTO `mm_information_descriptions` VALUES (10,3,'About Us','About Us','<p>&lt;div class=&quot;col-sm-6&quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;iframe width=&quot;100%&quot; height=&quot;100%&quot; src=&quot;https://www.youtube.com/embed/9prd9nCNQXI?rel=0&quot; frameborder=&quot;0&quot; allow=&quot;autoplay; encrypted-media&quot; allowfullscreen&gt;&lt;/iframe&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;/div&gt;<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;div class=&quot;col-sm-1&quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;div class=&quot;vl&quot;&gt; &lt;/div&gt;<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;/div&gt;</p>\r\n\r\n<p>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;div class=&quot;col-sm-5 about-right&quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;br&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;div class=&quot;row&quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;div class=&quot;col-sm-4 text-center p-0&quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;img src=&quot;{{ asset( &#39;frontend/images/tmm-logo2.png&#39; ) }}&quot; class=&quot;tmm-profile-logo &quot;&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;/div&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;div class=&quot;col-sm-8 text-center&quot;&gt;&lt;br&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&lt;h3&gt;Money Mile&lt;/h3&gt; &nbsp; &nbsp;&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;ul class=&quot;user-profile-social-ico&quot;&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;li&gt; &lt;a href=&quot;&quot;&gt; &lt;i class=&quot;fab fa-facebook fa-2x&quot;&gt;&lt;/i&gt; &lt;/a&gt; &lt;/li&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;li&gt; &lt;a href=&quot;&quot;&gt; &lt;i class=&quot;fab fa-linkedin fa-2x&quot;&gt;&lt;/i&gt; &lt;/a&gt; &lt;/li&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;li&gt; &lt;a href=&quot;&quot;&gt; &lt;i class=&quot;fab fa-google fa-2x&quot;&gt;&lt;/i&gt; &lt;/a&gt; &lt;/li&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;li&gt; &lt;a href=&quot;&quot;&gt; &lt;i class=&quot;fab fa-twitter-square fa-2x&quot;&gt;&lt;/i&gt; &lt;/a&gt; &lt;/li&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;/ul&gt;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;/div&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&lt;/div&gt; &nbsp;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&lt;br&gt;&lt;br&gt;&lt;br&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&lt;h1&gt;Your Money&#39;s Best Friend&lt;/h1&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&lt;p&gt;India&rsquo;s premier money, investment and personal finance offering. Founded by veteran business journalists Vivek Law, Mitali Mukherjee, finance guru Surya Bhatia and content creator Sumit Sabharwal that cuts across digital, TV and other mediums.&lt;/p&gt;<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&lt;/div&gt;</p>','About Us','About Us','About Us'),(8,3,'Privacy Policy','Privacy Policy','<h2><strong>Introduction</strong></h2>\r\n\r\n<p>The MoneyMile (we&rdquo; or &ldquo;us&rdquo;) values its visitors&rsquo; privacy. This privacy policy is effective Nov. 18; it summarizes what information we might collect from a registered user or other visitor (&ldquo;you&rdquo;), and what we will and will not do with it.</p>\r\n\r\n<p>Please note that this privacy policy does not govern the collection and use of information by companies that The MoneyMile does not control, nor by individuals not employed or managed by The MoneyMile. If you visit a Web site that we mention or link to, be sure to review its privacy policy before providing the site with information.</p>\r\n\r\n<h2><strong>What we do with your personally identifiable information </strong></h2>\r\n\r\n<p>It is always up to you whether to disclose personally identifiable information to us, although if you elect not to do so, we reserve the right not to register you as a user or provide you with any products or services. &ldquo;Personally identifiable information&rdquo; means information that can be used to identify you as an individual, such as, <strong>for example: </strong></p>\r\n\r\n<ul>\r\n	<li>your name, company, email address, phone number, billing address</li>\r\n	<li>your Company Name user ID and password credit card information</li>\r\n	<li>any account-preference information you provide us</li>\r\n	<li>your The MoneyMile domain name and IP address, indicating where your computer is located on the Internet</li>\r\n	<li>session data for your login session, so that our computer can &lsquo;talk&rsquo; to yours while you are logged in</li>\r\n</ul>\r\n\r\n<p>If you do provide personally identifiable information to us, either directly or through a reseller or other business partner, we will:</p>\r\n\r\n<ul>\r\n	<li>not sell or rent it to a third party without your permission &mdash; although unless you opt out (see below), we may use your contact information to provide you with information we believe you need to know or may find useful, such as (for example) news about our services and products and modifications to the Terms of Service;</li>\r\n	<li>take commercially reasonable precautions to protect the information from loss, misuse and unauthorized access, disclosure, alteration and destruction;</li>\r\n	<li>not use or disclose the information except:</li>\r\n	<li>as necessary to provide services or products you have ordered, such as (for example) by providing it to a carrier to deliver products you have ordered;</li>\r\n	<li>in other ways described in this privacy policy or to which you have otherwise consented;</li>\r\n	<li>in the aggregate with other information in such a way so that your identity cannot reasonably be determined (for example, statistical compilations);</li>\r\n	<li>as required by law, for example, in response to a subpoena or search warrant;</li>\r\n	<li>to outside auditors who have agreed to keep the information confidential;</li>\r\n	<li>as necessary to enforce the Terms of Service;</li>\r\n	<li>as necessary to protect the rights, safety, or property of The MoneyMile, its users, or others; this may include (for example) exchanging information with other organizations for fraud protection and/or risk reduction.</li>\r\n</ul>\r\n\r\n<h2><strong>Other information we collect </strong></h2>\r\n\r\n<p>We may collect other information that cannot be readily used to identify you, such as (for example) the domain name and IP address of your computer. We may use this information, individually or in the aggregate, for technical administration of our Web site(s); research and development; customer- and account administration; and to help us focus our marketing efforts more precisely.</p>\r\n\r\n<h2>Cookies</h2>\r\n\r\n<p>The MoneyMile uses &ldquo;cookies&rdquo; to store personal data on your computer. We may also link information stored on your computer in cookies with personal data about specific individuals stored on our servers. If you set up your Web browser (for example, Internet Explorer or Firefox) so that cookies are not allowed, you might not be able to use some or all of the features of our Web site(s).</p>\r\n\r\n<h2>External data storage sites</h2>\r\n\r\n<p>We may store your data on servers provided by third party hosting vendors with whom we have contracted.</p>\r\n\r\n<h2>Your privacy responsibilities</h2>\r\n\r\n<p>To help protect your privacy, be sure:</p>\r\n\r\n<ul>\r\n	<li>not to share your user ID or password with anyone else;</li>\r\n	<li>to log off the Company Name Web site when you are finished;</li>\r\n	<li>to take customary precautions to guard against &ldquo;malware&rdquo; (viruses, Trojan horses, bots, etc.), for example by installing and updating suitable anti-virus software.</li>\r\n</ul>\r\n\r\n<h2>Notice to European Union users</h2>\r\n\r\n<p>Company Name&lsquo;s operations are located primarily in the United States. If you provide information to us, the information will be transferred out of the European Union (EU) to the United States. By providing personal information to us, you are consenting to its storage and use as described herein.</p>\r\n\r\n<h2>Information collected from children</h2>\r\n\r\n<p>You must be at least 13 years old to use The MoneyMile Web site(s) and service(s). Company Name does not knowingly collect information from children under 13. (See the U.S. Children&rsquo;s Online Privacy Protection Act.)</p>\r\n\r\n<h2>Changes to this privacy policy</h2>\r\n\r\n<p>We reserve the right to change this privacy policy as we deem necessary or appropriate because of legal compliance requirements or changes in our business practices. If you have provided us with an email address, we will endeavor to notify you, by email to that address, of any material change to how we will use personally identifiable information.</p>\r\n\r\n<h2>Questions or comments?</h2>\r\n\r\n<p>If you have questions or comments about The MoneyMile privacy policy, send an email to <a href=\"http://support@themoneymile.com\">support@themoneymile.com</a>, or contact us via any of the ways described in the About Us page at URL of company&#39;s website. Thank you for choosing Company Name!</p>','Privacy Policy','Privacy Policy','Privacy Policy'),(8,4,'sd','asdsdf','<p>sadfd asdf</p>','adsdsf','asdfd','adsf'),(9,3,'Terms of Service','Terms of Service','<h2>Conditions of Use</h2>\r\n\r\n<p><br />\r\nWe will provide their services to you, which are subject to the conditions stated below in this<br />\r\ndocument. Every time you visit this website, use its services or make a purchase, you accept<br />\r\nthe following conditions. This is why we urge you to read them carefully.</p>\r\n\r\n<h2><br />\r\nPrivacy Policy</h2>\r\n\r\n<p><br />\r\nBefore you continue using our website we advise you to read our privacy policy [link to privacy<br />\r\npolicy] regarding our user data collection. It will help you better understand our practices.<br />\r\nCopyright<br />\r\nContent published on this website (digital downloads, images, texts, graphics, logos) is the<br />\r\nproperty of [name] and/or its content creators and protected by international copyright laws. The<br />\r\nentire compilation of the content found on this website is the exclusive property of [name], with<br />\r\ncopyright authorship for this compilation by [name].</p>','Terms of Service','Terms of Service',NULL);
