INSERT INTO `mm_speaker_descriptions` VALUES (3,3,'Surya Bhatia','Promoter of Asset Managers & Co founder','Surya Bhatia is a Chartered Accountant qualified in May’98. During his two year stint in a CA firm where he worked in the capacity as a partner, he developed a passion for personal finance and started developing experience and expertise in the same.','<p>Surya Bhatia is a Chartered Accountant qualified in May&rsquo;98. During his two year stint in a CA firm where he worked in the capacity as a partner, he developed a passion for personal finance and started developing experience and expertise in the same.</p>\r\n\r\n<p>Along with pursuing his passion for personal finance he started doing CFP (Certified Financial Planner) when launched in India, he did his CFP via the challenge status. In the year 2003, he started his own wealth boutique firm &ldquo;Asset Managers&rdquo; &ndash; a financial advisory concern advising on money management principles and over the last 15 years, he has been helping individuals and Small &amp; Medium Enterprise (SME) to create, manage and grow their assets. He has also been spreading financial awareness by doing TV shows more popularly &ldquo;Let&rsquo;s talk Money&rdquo; on NDTV Profit, &ldquo;Dhan Daulat&rdquo; on Aaj Tak, &ldquo;Money&rsquo;s Best Friend&rdquo; on India Today TV, &ldquo;Smart Money&rdquo; on Bloomberg and contributing towards financial literacy through workshops for corporates,</p>\r\n\r\n<p>Financial Planning Board and via print media by writing articles and columns and is currently writing a weekly column for HT-MINT. And with the advent of social media as a platform, through their new venture @ Money Mile, he is spreading financial literacy via face book, Youtube.</p>','Promoter of Asset Managers & Co founder @ Money Mile','Surya Bhatia','Surya Bhatia','Surya Bhatia'),(4,3,'Vivek Law','Founder, CEO & Editor-in-Chief','Vivek Law is Founder, CEO & Editor-in-Chief, The MoneyMile, a digital video platform to demystify money. ','<p>Vivek Law is Founder, CEO &amp; Editor-in-Chief, The MoneyMile, a digital&nbsp; video platform to demystify money.&nbsp;</p>\r\n\r\n<p>An award-winning journalist who has, in his career of more than 24 years, worked across the biggest print and television brands, in his latest avatar, the senior business journalist drives the video-first digital content platform for Indians seeking insight and financial advice on personal wealth.</p>\r\n\r\n<p>In his print career spanning a decade, he has worked with <strong>The Economic Times, Business Standard</strong>, <strong>The Financial Express and India Today</strong>.</p>\r\n\r\n<p>He has also served as Consumer Affairs Editor at CNBC TV18 and CNBC Awaaz, and Editor, Bloomberg TV India for 4 years, before moving to the India Today Group as Editor-Business Television. Shows he has anchored across these TV brands, in English and Hindi, include Uncovered, Pardafash, Pehredar, Smart Money, Money&#39;s Best Friend, Market Guru, Big Story, Courtroom, Fightback for Your Rights and Dhan Daulat.</p>\r\n\r\n<p>Vivek has served on the boards of <strong>FPSB</strong> and <strong>NBSA</strong>. He is also author of <strong>The Money Book</strong> (<strong>Rupa, 2016</strong>).</p>','Vivek Law is Founder, CEO & Editor-in-Chief, The MoneyMile, a digital video platform to demystify money. ','Vivek Law','vivek law',NULL),(3,4,'df','asdsf','asdf','<p>adsf</p>','asdf','asddf','adsf',NULL),(4,4,'df','asdsf','asdf','<p>adsf</p>','asdf','asddf','adsf',NULL);
